
import React, { useEffect, useState } from 'react';
import { SafeAreaView, View, Text, TouchableOpacity, ScrollView, Image, Modal } from 'react-native';
import axios from 'axios';
import BackButton from '../../../Utilites/Breadcrumbs/BackButton';
import Config from 'react-native-config';
import { Map } from '../../../Ui/icons';
import { useSafeAreaInsets } from 'react-native-safe-area-context';

export default function ReportManagement() {
  const insets = useSafeAreaInsets();
  const [submissions, setSubmissions] = useState<any[]>([]);
  const [reportVisible, setreportVisible] = useState(false);
  const [selectedSubmission, setSelectedSubmission] = useState<any>(null);

  useEffect(() => {
    const fetchSubmissions = async () => {
      try {
        const response = await axios.get(`${Config.API_URL}submissions`);
        setSubmissions(response.data);
        console.log('Fetched Submissions:', response.data);
      } catch (error) {
        console.log('Error fetching submissions:', error);
      }
    };
    fetchSubmissions();
  }, []);

  const demoData = [
    {
      contractorName: "William",
      contractorId: "CT2025101",
      locationName: "Bayshore Global 28 Duxton Hill",
      cleanerName: "Adrian",
      cleanerId: "CL2025102",
      workStatus: [
        { area: "Main entrance & Reception", status: "completed" },
        { area: "Main waiting area", status: "completed" },
        { area: "Pantry area", status: "completed" },
        { area: "Stationary area", status: "completed" },
        { area: "Restroom", status: "completed" },
      ],
      submissionDate: "2025-08-06",
      submissionTime: "12:30 PM",
      signature: "",
    },
    
  ];

  const allData = submissions.length > 0 ? submissions : demoData;

  return (
    <SafeAreaView className="flex-1 bg-primary"
      style={{ paddingTop: insets.top + 10 }}>
      <BackButton
        TouchablityOpacityclassName="flex-row gap-5  p-5 "
        className="text-[20px] font-outfit-semibold text-textWhite"
        name="Report Management"
      />

      <ScrollView contentContainerStyle={{ padding: 16 }} className="bg-background rounded-t-3xl">
        <View className="gap-6 justify-center ">
          {allData.length > 0 ? (
            allData.map((item, index) => (
              <TouchableOpacity
                key={index}
                className="bg-background rounded-3xl p-3 border border-gray-200"
                style={{ boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.1)' }}
                onPress={() => {
                  setSelectedSubmission(item);
                  setreportVisible(true);
                }}
              >
                <View className="p-6 bg-gray-100 rounded-t-3xl">
                  <Text
                    className="text-primary font-outfit-semibold"
                    numberOfLines={1}
                    ellipsizeMode="tail"
                  >
                    {item.contractorName}
                  </Text>
                  <Text className="text-gray-700 font-outfit-bold">
                    {item.contractorId}
                  </Text>
                </View>

                <View className="h-10 flex-row justify-center items-center mt-2 px-5">
                  <Map height={15} stroke={"gray"} />
                  <Text
                    className="text-gray-700 font-outfit-semibold"
                    numberOfLines={1}
                    ellipsizeMode="tail"
                  >
                    {item.locationName}
                  </Text>
                </View>
                <View>
                  <Text className="text-center text-primary">More</Text>
                </View>
              </TouchableOpacity>
            ))
          ) : (
            <View className="  h-full w-fulljustify-center items-center">
              <View className='justify-center items-center h-[400px] w-[400px] mt-32'>
                <Image source={require('../../../assets/noDataFound/noDataFound.png')}
                    style={{
                      width: '100%',
                      height: '100%',
                      resizeMode: 'cover',
                    }}
                    className="rounded-full"/>
              </View>
              <Text className=' -top-14 text-[20px] font-outfit-extrabold text-blue-950'>No Report Found!</Text>
            </View>
          )}
        </View>
      </ScrollView>


      <Modal
        visible={reportVisible}
        animationType='slide'
        transparent
      >
        <View className='bg-primary w-full h-full'>
          <TouchableOpacity onPress={() => {
            setreportVisible(false);
            setSelectedSubmission(null);
          }}
            className="flex-row gap-5 p-3">
            <Text className='text-[20px] font-outfit-semibold text-textWhite'>‚Üê</Text>
            <Text className='text-[20px] font-outfit-semibold text-textWhite'>Report Management</Text>
          </TouchableOpacity>



          <ScrollView className="bg-background rounded-t-3xl h-full p-5">
            {selectedSubmission && (
              <View className="p-5 border border-gray-200 rounded-xl">

                <View className='flex-row justify-center  pb-3'>
                  <View className=' absolute left-0 w-[50px] h-[50px] rounded-full'>
                    <Image source={require('../../../assets/Login/logo.png')}
                      style={{
                        width: '100%',
                        height: '100%',
                        resizeMode: 'cover',
                      }}
                      className='rounded-full' />
                  </View>
                  <View>
                    <Text className='text-[30px] font-outfit-semibold text-green-600 text-center capitalize'>kleenmatic</Text>
                    <Text className='text-[15px] font-outfit-medium text-gray-400 text-center'>service</Text>
                  </View>
                </View>

                <View className="mb-6">
                  <Text className="text-[15px] font-bold text-gray-800 mb-3 border-b border-gray-200 pb-2">
                    CONTRACTOR DETAILS
                  </Text>
                  <View className="flex-row justify-between my-3">
                    <Text className="text-gray-600 font-medium">Contractor Name:</Text>
                    <Text className="text-gray-800 font-semibold flex-1 text-right"
                      numberOfLines={1}
                      ellipsizeMode='tail'>
                      {selectedSubmission.contractorName}
                    </Text>
                  </View>
                  <View className="flex-row justify-between mb-2">
                    <Text className="text-gray-600 font-medium">Contractor ID:</Text>
                    <Text className="text-gray-800 font-semibold flex-1 text-right">
                      {selectedSubmission.contractorId}
                    </Text>
                  </View>
                  <View className="flex-row justify-between">
                    <Text className="text-gray-600 font-medium">Location:</Text>
                    <Text className="text-gray-800 font-semibold flex-1 text-right"
                      numberOfLines={1}
                      ellipsizeMode='tail'>
                      {selectedSubmission.locationName}
                    </Text>
                  </View>
                </View>

                <View className="mb-6">
                  <Text className="text-[15px] font-bold text-gray-800 mb-3 border-b border-gray-200 pb-2">
                    CLEANER DETAILS
                  </Text>
                  <View className="flex-row justify-between">
                    <Text className="text-gray-600 font-medium">Cleaner Name:</Text>
                    <Text className="text-gray-800 font-semibold flex-1 text-right">
                      {selectedSubmission.cleanerName}
                    </Text>
                  </View>
                  <View className="flex-row justify-between">
                    <Text className="text-gray-600 font-medium">Cleaner ID:</Text>
                    <Text className="text-gray-800 font-semibold flex-1 text-right">
                      {selectedSubmission.cleanerId}
                    </Text>
                  </View>
                </View>

                <View className="mb-6">
                  <Text className="text-[15px] font-bold text-gray-800 mb-3 border-b border-gray-200 pb-2">
                    WORK STATUS
                  </Text>
                  <View className="space-y-2">
                    {selectedSubmission.workStatus?.map((work: any, i: number) => (
                      <View key={i} className="flex-row justify-between py-2 px-3">
                        <Text className="text-gray-700 font-medium">{work.area}</Text>
                        <View
                          className={`px-3 py-1 rounded-full ${work.status === 'completed'
                            ? 'bg-green-100'
                            : work.status === 'pending'
                              ? 'bg-yellow-100'
                              : 'bg-red-100'
                            }`}
                        >
                          <Text
                            className={`text-sm font-semibold ${work.status === 'completed'
                              ? 'text-green-800'
                              : work.status === 'pending'
                                ? 'text-yellow-800'
                                : 'text-red-800'
                              }`}
                          >
                            {work.status}
                          </Text>
                        </View>
                      </View>
                    ))}
                  </View>
                </View>

                <View className="border-t border-gray-200 pt-4">
                  <View className="flex-row justify-between ">

                    <View className="">
                      <View className="flex-row">
                        <Text className="text-gray-600 text-sm font-medium w-12">Date:</Text>
                        <Text className="text-gray-800 text-sm font-semibold">
                          {selectedSubmission.submissionDate.slice(0, 10)}
                        </Text>
                      </View>
                      <View className="flex-row">
                        <Text className="text-gray-600 text-sm font-medium w-12">Time:</Text>
                        <Text className="text-gray-800 text-sm font-semibold">
                          {selectedSubmission.submissionTime}
                        </Text>
                      </View>
                    </View>

                    <View className="items-center">
                      <Text className="text-sm font-bold text-gray-800">SIGNATURE</Text>
                      <View className="border-gray-300 rounded-lg p-2 w-[50px] h-[50px] items-center justify-center">
                        {selectedSubmission.signature && (
                          <Image
                            source={{ uri: `data:image/png;base64,${selectedSubmission.signature}` }}
                            style={{ width: 50, height: 50 }}
                            resizeMode="contain"
                          />
                        )}
                      </View>
                    </View>
                  </View>
                </View>
              </View>
            )}
          </ScrollView>

        </View>
      </Modal>
    </SafeAreaView>

  );
}